import React from 'react';
import style from './MainDogCard.module.css';

export const MainDogCard = (props) => {
    const backgroundStyle = {
        backgroundImage: props.image
    }

    return (
        <div style={backgroundStyle} className={style.dogCard}>
            <div>
                <p></p>
            </div>
        </div>
    )
}
